def find_pair_across_circle(n, getnum):
    if n % 4 != 2:
        return -1
    lo = 1
    hi = n // 2 + 1
    t1 = getnum(lo)
    t2 = getnum(hi)
    lo2 = t1 - t2
    hi2 = t2 - t1
    if lo2 == 0:
        return 1
    while lo < hi:
        mid = (lo + hi) // 2
        mid2 = getnum(mid) - getnum(mid + n // 2)
        if mid2 == 0:
            return mid
        if (lo2 > 0) == (mid2 > 0):
            lo = mid + 1
        else:
            hi = mid - 1
    return lo

